class Solution {
    func countTestedDevices(_ batteryPercentages: [Int]) -> Int {
        var testedCount = 0
        var mutableBatteryPercentages = batteryPercentages

        for i in 0..<mutableBatteryPercentages.count {
            if mutableBatteryPercentages[i] > 0 {
                testedCount += 1
                for j in (i + 1)..<mutableBatteryPercentages.count {
                    mutableBatteryPercentages[j] = max(0, mutableBatteryPercentages[j] - 1)
                }
            }
        }

        return testedCount
    }
}
